				</div>
				<div className='main'>
					<ProjectContainer 
						title="Test Title"
						description="This is a test description"
						image="<INSERT IMAGE LINK HERE>"
					/>
				</div>
				<div className='right-margin'>

				</div>
			</div>
		);
	}
}

export default HomeScreen;
